   "source": [
    "## Variables and types\n",
    "\n",
    "There are different types of built-in objects in Python (and remember that everything in Python is an object):"
   ]
  },
  {
   "cell_type": "code",
   "execution_count": 30,
   "metadata": {
    "collapsed": false
   },
