   "source": [
    "## Built-in Constants\n",
    "\n",
    "- **False** : false value of the bool type\n",
    "- **True** : true value of the bool type\n",
    "- **None** : sole value of types.NoneType. None is frequently used to represent the absence of a value."
   ]
  },
  {
   "cell_type": "markdown",
   "metadata": {},
   "source": [
    "In computer science, the Boolean or logical data type is composed by two values, true and false, intended to represent the values of logic and Boolean algebra. In Python, 1 and 0 can also be used in most situations as equivalent to the Boolean values."
   ]
  },
  {
   "cell_type": "markdown",
   "metadata": {},
   "source": [
    "## Logical (Boolean) operators"
   ]
  },
  {
   "cell_type": "markdown",
   "metadata": {},
   "source": [
    "### and, or, not"
   ]
  },
  {
   "cell_type": "markdown",
   "metadata": {},
   "source": [
    "- **and** : logical AND operator. If both the operands are true then condition becomes true.\t (a and b) is true.\n",
    "- **or** : logical OR Operator. If any of the two operands are non zero then condition becomes true.\t (a or b) is true.\n",
    "- **not** : logical NOT Operator. Reverses the logical state of its operand. If a condition is true then logical NOT operator will make false."
   ]
  },
  {
   "cell_type": "markdown",
   "metadata": {},
   "source": [
    "### Comparisons\n",
    "\n",
    "The following comparison operations are supported by objects in Python:\n",
    "\n",
    "- **==** : equal\n",
    "- **!=** : not equal\n",
    "- **<**\t: strictly less than\n",
    "- **<=** : less than or equal\n",
    "- **\\>** : strictly greater than\n",
    "- **\\>=** : greater than or equal\n",
    "- **is** : object identity\n",
    "- **is not** : negated object identity"
   ]
  },
