    "## Indentation and whitespace\n",
    "\n",
    "In Python, statement grouping is done by indentation (this is mandatory), which are done by inserting whitespaces, not tabs. Indentation is also recommended for alignment of function calling that span more than one line for better clarity.   \n",
    "We will see examples of indentation in the next session."
   ]
  },
  {
   "cell_type": "markdown",
   "metadata": {},
   "source": [
    "## Control of flow\n",
    "\n",
    "### `if`...`elif`...`else`\n",
    "\n",
    "Conditional statements (to peform something if another thing is True or False) can be implemmented using the `if` statement:\n",
    "```\n",
    "if expression:\n",
    "   statement\n",
    "elif:\n",
    "   statement     \n",
    "else:\n",
    "   statement\n",
    "```\n",
    "`elif` (one or more) and `else` are optionals.   \n",
    "The indentation is obligatory.   \n",
    "For example:"
   ]
  },
  {
   "cell_type": "code",
   "execution_count": 71,
   "metadata": {
    "collapsed": false
   },
   "outputs": [],
   "source": [
    "if True:\n",
    "    pass"
   ]
  },
  {
   "cell_type": "markdown",
   "metadata": {},
   "source": [
    "Which does nothing useful.   \n",
    "\n",
    "Let's use the `if`...`elif`...`else` statements to categorize the [body mass index](http://en.wikipedia.org/wiki/Body_mass_index) of a person:"
   ]
  },
  {
   "cell_type": "code",
   "execution_count": 72,
   "metadata": {
    "collapsed": false
   },
   "outputs": [],
   "source": [
    "# body mass index\n",
    "weight = 100  # kg\n",
    "height = 1.70  # m\n",
    "bmi = weight / height**2"
