   "source": [
    "### Interpolation\n",
    "\n",
    "Consider the following data:"
   ]
  },
  {
   "cell_type": "code",
   "execution_count": 97,
   "metadata": {
    "collapsed": false,
    "run_control": {
     "breakpoint": false
    }
   },
   "outputs": [],
   "source": [
    "y = [5,  4, 10,  8,  1, 10,  2,  7,  1,  3]"
   ]
  },
  {
   "cell_type": "markdown",
   "metadata": {},
   "source": [
    "Suppose we want to create data in between the given data points (interpolation); for instance, let's try to double the resolution of the data by generating twice as many data:"
   ]
  },
  {
   "cell_type": "code",
   "execution_count": 98,
   "metadata": {
    "collapsed": false,
    "run_control": {
     "breakpoint": false
    }
   },
   "outputs": [
    {
     "data": {
      "text/plain": [
       "array([ 5.        ,  4.52631579,  4.05263158,  6.52631579,  9.36842105,\n",
       "        9.26315789,  8.31578947,  5.78947368,  2.47368421,  3.36842105,\n",
       "        7.63157895,  8.31578947,  4.52631579,  2.78947368,  5.15789474,\n",
       "        6.36842105,  3.52631579,  1.10526316,  2.05263158,  3.        ])"
      ]
     },
     "execution_count": 98,
     "metadata": {},
     "output_type": "execute_result"
    }
   ],
   "source": [
    "t = np.linspace(0, len(y), len(y))       # time vector for the original data\n",
    "tn = np.linspace(0, len(y), 2 * len(y))  # new time vector for the new time-normalized data\n",
    "yn = np.interp(tn, t, y)                 # new time-normalized data\n",
    "yn"
   ]
  },
  {
   "cell_type": "markdown",
   "metadata": {},
   "source": [
    "The key is the Numpy `interp` function, from its help:   \n",
    "\n",
    "    interp(x, xp, fp, left=None, right=None)       \n",
    "    One-dimensional linear interpolation.   \n",
    "    Returns the one-dimensional piecewise linear interpolant to a function with given values at discrete data-points.\n",
    "\n",
    "A plot of the data will show what we have done:"
   ]
  },
